CREATE DEFINER=`root`@`localhost` FUNCTION `cal_rating`(
    player_id INT,
    last_rating INT,
    netscore INT,
    player_games INT,
    avg_table_rating INT
) RETURNS decimal(10,5)
    DETERMINISTIC
BEGIN
    DECLARE games_no_correction DECIMAL(10, 5);
    DECLARE correction_value DECIMAL(10, 5);
    DECLARE rating_change DECIMAL(10, 5);
    DECLARE new_rating DECIMAL(10, 5);

    -- Calculate Games No. Correction (fixed at 0.2 if games played > 400)
    IF player_games > 400 THEN
        SET games_no_correction = 0.2;
    ELSE
        SET games_no_correction = 1 - (player_games * 0.002);
    END IF;

    -- Calculate Correction Value
    SET correction_value = (avg_table_rating - last_rating) / 40;

    -- Calculate Rating Change
    SET rating_change = games_no_correction * ((netscore / 10) + correction_value);

    -- Calculate New Rating
    SET new_rating = last_rating + rating_change;

    RETURN new_rating;
END ;;
