      SELECT COUNT(*) INTO v_player_games FROM game_ratings WHERE uid = v_uid AND gid < v_gid;

      -- Get avg_table_rating of the game (recompute from actual participants)
      SELECT AVG(last_rating)
      INTO v_avg_table_rating
      FROM (
        SELECT find_prev_rating(gid, uid) AS last_rating
        FROM game_ratings
        WHERE gid = v_gid
      ) AS ratings;

      -- Recalculate rating change using cal_rating function
      SET v_rating_change = cal_rating(v_uid, v_last_rating, v_netscore, v_player_games, v_avg_table_rating) - v_last_rating;

      -- Calculate new_rating as the sum of last_rating + rating_change
      SET v_new_rating = v_last_rating + v_rating_change;

      -- Update game_ratings for this player and game
      UPDATE game_ratings
      SET last_rating = v_last_rating,
          avg_table_rating = v_avg_table_rating,
          rating_change = v_rating_change,
          new_rating = v_new_rating
      WHERE gid = v_gid AND uid = v_uid;
    END IF;
  END LOOP;

  CLOSE cur;
  DROP TEMPORARY TABLE IF EXISTS temp_uids;
END ;;
