CREATE DEFINER=`root`@`localhost` PROCEDURE `delete_game_rating`(IN target_gid INT)
BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE uid_val INT;
    DECLARE next_gid INT;
    DECLARE last_rating DECIMAL(10,5);
    DECLARE netscore_val INT;
    DECLARE player_games INT;
    DECLARE rating_change DECIMAL(10,5);
    DECLARE new_rating_val DECIMAL(10,5);
    DECLARE avg_rating DECIMAL(10,5);

    DECLARE user_cursor CURSOR FOR
        SELECT uid FROM game_ratings WHERE gid = target_gid;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    OPEN user_cursor;

    user_loop: LOOP
        FETCH user_cursor INTO uid_val;
        IF done THEN
            LEAVE user_loop;
        END IF;

        -- Delete the record for this user in target game
        DELETE FROM game_ratings WHERE gid = target_gid AND uid = uid_val;

        -- Recalculate for all future games of this player
        SET next_gid = target_gid + 1;

        future_loop: LOOP
            -- Break if there's no next game
            IF (SELECT COUNT(*) FROM game_ratings WHERE uid = uid_val AND gid = next_gid) = 0 THEN
                LEAVE future_loop;
            END IF;

            -- Get netscore
            SELECT netscore INTO netscore_val FROM game_ratings WHERE uid = uid_val AND gid = next_gid;

            -- Get updated last_rating using helper function
            SET last_rating = find_prev_rating(next_gid, uid_val);

            -- Get number of games played
            SELECT COUNT(*) INTO player_games FROM game_ratings WHERE uid = uid_val AND gid < next_gid;

            -- Temporarily update last_rating
            UPDATE game_ratings SET last_rating = last_rating WHERE gid = next_gid AND uid = uid_val;

            -- Calculate avg_table_rating again for that game
            SELECT AVG(last_rating) INTO avg_rating FROM game_ratings WHERE gid = next_gid;

            -- Update avg_table_rating for all rows in that game
            UPDATE game_ratings SET avg_table_rating = avg_rating WHERE gid = next_gid;

            -- Recalculate rating_change
            SET rating_change = cal_rating(uid_val, next_gid, last_rating, netscore_val, player_games);

            -- Update new_rating
            SET new_rating_val = last_rating + rating_change;
            UPDATE game_ratings 
            SET rating_change = rating_change,
                new_rating = new_rating_val
            WHERE gid = next_gid AND uid = uid_val;

            -- Move to next game
            SET next_gid = next_gid + 1;
        END LOOP;

    END LOOP;
    
    CLOSE user_cursor;

    -- Finally, delete the target_gid row from all users (if not already deleted above)
    DELETE FROM game_ratings WHERE gid = target_gid;
END ;;
